import React from "react";
import Content from "./components/Content";
import Header from "./components/Header";
import Search from "./components/Search";
import SearchContext from "./context/searchContext";

const App = () => {
  return (
    <>
      <SearchContext>
        <Header />
        <Search />
        <Content />
      </SearchContext>
    </>
  );
};

export default App;
